import { store } from "./store/store";
import { Provider } from "react-redux";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <Provider store={store}>
      <ContextProvider>
        <App />
        /ContextProvider>
      </ContextProvider>
    </Provider>

    {/* <LoginContextProvider>
